ron aŭ naziojn","it":"a mano a mano che una discussione online si allunga, la probabilità di un paragone riguardante i nazisti o Hitler, tende ad 1","he":"כלל הקובע כי ככל שמתארך דיון מקוון עולה ההסתברות שיוזכר במהלכו שמו של היטלר","fr":"règle empirique","gu":"ગ Godડવિનનો કાયદો માઇક ગોડવિન દ્વારા બનાવવામાં આવેલ ઇન્ટરનેટ પરનો સૌથી જૂનો સંભારણા તરીકે ઓળખાય છે. મેમ્સનો અર્થ એમ કહેવાનો છે કે: conversationનલાઇન વાતચીત જેટલી લાંબી ચાલશે, ત્યાં હિટલરનો ઉલ્લેખ કરવાની વધુ સંભાવના છે.","zh-hant":"戈德溫定律是互聯網上最古老的模因，由邁克·戈德溫（Mike Godwin）制定。模因的意思是：在線對話持續的時間越長，提及希特勒的機會就越大。","ru":"выражение в интернет-культуре, описывающее вероятность упоминания нацизма или Гитлера в дискуссиях"},"lang":"en"},"aliases":{"lang2values":{"zh":["戈德温法则"],"pl":["Prawo Perdono","Argumentum ad Hitlerum","Reductio ad Hitlerum","Reguła Godwina Analogii do hitleryzmu"],"fr":["Point goodwin","Points Godwin","Point Goldwin","Le point godwin","Point godwin","Loi de Goodwin"],"he":["חוק גודוין"],"es":["Ley de Godwin/"],"de":["Mike Godwin","Godwins Gesetz","Godwin's Law","Godwins Law"],"br":["Poent Godwin","Godwin's law"],"el":["Νόμος του Godwin"],"nl":["Godwin's Law","Godwin's wet"],"sv":["Godwins sats"],"pt":["Godwin's law"],"ru":["Правило Годвина"],"sr":["Годвиново правило","Годвиново правило аналогија са нацистима"],"ca":["Regla de Godwin de l'analogia amb els nazis","Regla de Godwin"],"uk":["Закон Годвіна"],"sl":["Godwinovo pravilo o prilikovanju z nacizmom"],"en":["Godwin's Rule of Nazi Analogies","Godwin's Law of Nazi Analogies"]},"lang":"en"},"source":"Q2071976","score":266.25}
